import React from 'react';

const About = () => {
    return (
        <div id="secondPage"class="secondPage">
                <div class="whoWhatWhere clearfix">
                <h3 class="smallTitle">Who I Am</h3>
                    <h4 class="bigTitle">Filmmaker + Front-End Web Developer</h4>
