                </div>
                <div class="pageLinks">
                    <a class="sectionLink" href="#thirdPage">Websites</a>
                    <a class="sectionLink" href="#fourthPage">Films</a>
                    {/*<a class="sectionLink" href="#fifthPage">Photography</a>*/}
                </div>
            </div>
    )
}

export default About;
